import React, { useState } from 'react'
import LineChart from './LineChart';

// const data_graph = fetch('/api/datos').then(res => res.json()).catch(err => console.log(err));
/*
function GetData() {
    const data = {
        datasets : [
            {
                label: "datos",
                data: datos
            },
        ],
        labels,
    };

    return (
        <div className="grafico">
            <Bar data={data} options={options} />
        </div>
    )
}

GetData();
*/

const GetRadon = () => {

    const [sensor, setData] = React.useState([]);

    React.useEffect(() => {
        obtenerDatos()
    }, []);

    const obtenerDatos = async () => {
        const data = await fetch('/api/radon')
        const dataSensor = await data.json()
        setData(dataSensor)
    }

    const [sensorplot, setSensorData] = useState({
        labels: sensor.map((data) => data.ts),
        datasets: [{
            label: "data sensor",
            data: sensor.map((data) => data.value),
        }]
    })
}

export default GetData;
